import React from 'react';
import {createStore} from 'redux';

let store = createStore(reducer);

function reducer(state={search: ''}, action) {
    let newState = { ...state };

    switch(action.type) {
        case 'search':
            newState.value = newState.value + 1;
            return newState

        default :
            return newState
    }
}

export default store;
